    .then(resp => resp.json())
    .then(data => mountGig(data))
}

mountGig = data => {
    return (
        <p>{data.resultsPage.results.event.displayName}</p>
    )
}


render() {
    console.log(this.props.artistGigs)
    return (
        <div>
            Hello
            {this.props.artistGigs.map((gig, index) => (

                <p key={index}>{this.fetchGig(gig)}</p>
            ))}
        </div>
    )
}

}

